# Plotting the users’ ages

plt.figure(figsize=(15,7))
age_plot = sns.countplot(newAge)

for num, label in enumerate(age_plot.get_xticklabels()):
    if num % 5 == 0:
        label.set_visible(True)
    else:
        label.set_visible(False)

plt.grid(linestyle='--', linewidth=1, alpha=0.5)
plt.show()
